import React from "react";

const Home = () => {
  return (
    <div id="menu">
      <div class="menu-items">
        <a href="paint.html" class="menu-item">
          <h1>Paint</h1>
        </a>
        <a href="settings.html" class="menu-item">
          Settings
        </a>
        <a href="/About.js" class="menu-item">
          About
        </a>
        <a href="contact.html" class="menu-item">
          Contact
        </a>
      </div>
      <div id="menu-background"></div>
    </div>
  );
};

export default Home;
